function getPathFromURL(url) {
    try {
        // Usa regex para extrair o caminho da URL
        const match = url.match(/^https?:\/\/[^/]+(\/[^?#]*)/);
        if (match) {
            return match[1]; // Retorna o path
        } else {
            return "Invalid URL";
        }
    } catch (error) {
        console.error("Erro ao processar a URL:", error.message);
        return "Invalid URL";
    }
}

